var output = {};

var counter = 0;

for(var cidString in comOverrideFiles) {
    var comEntry = comOverrideFiles[cidString];

    //com file properties
    var properties = {};
    properties.file_context = "com_" + cidString;
    properties.name = "Standard";
    properties.ref = "legacy";

    var comFileRecord = micemetarDataAccess.createRecord("com_file",properties);

    //base entries (all standard)
    var baseFileRecordList = getBaseFileRecords(comFileRecord.Id);

    //meta file entries
    var metaFileRecordList = getMetaFileRecords(comFileRecord.Id,comEntry);

    var combinedEntry = {};
    combinedEntry.comFile = comFileRecord;
    combinedEntry.baseFileList = baseFileRecordList;
    combinedEntry.metaFileList = metaFileRecordList;

    output[cidString] = combinedEntry;

    // counter++;
    // if(counter > 20) break;
}

return output;

