function getBaseFileRecords(comFileId) {
    var copyBasePropertyList = apogee.util.jsonCopy(basePropertyList);
    copyBasePropertyList.forEach( (element) => {element.com_file_id = comFileId});

    return copyBasePropertyList.map( (propEntry) => micemetarDataAccess.createRecord("com_file_entry",propEntry));
}


function getMetaFileRecords(comFileId,comEntry) {
    var metaFileList = [];
    for(var key in comEntry.data) {
        var entrySection = comEntry.data[key];
        var urlList;

        var repeatList = [];

        switch(key) {
            case "themeOverrides":
                for(var themeName in entrySection) {
                    urlList = entrySection[themeName];
                    processUrlList(urlList,metaFileList,repeatList);
                }
                break;

            case "presetOverrides":
            case "themeMapOverrides":
            case "inputColorOverrides":
            case "stringsOverrides":
                urlList = entrySection;
                processUrlList(urlList,metaFileList,repeatList);
                break;
        }
    }

    //meta file info
    //meta file id
    //create records
    var createdRecords = [];
    for(var i = 0; i < metaFileList.length; i++) {
        var metaFile = metaFileList[i];

        //create the com file entry
        var comFileEntryProps = {};
        comFileEntryProps.com_file_id = comFileId;
        comFileEntryProps.meta_file_id = metaFile.Id;
        comFileEntryProps.fileGroup = "override";
        comFileEntryProps.ordr = i;
        var comFileEntry = micemetarDataAccess.createRecord("com_file_entry",comFileEntryProps);
        createdRecords.push(comFileEntry);
    }   


    return createdRecords;
}

function processUrlList(urlList,metaFileList,repeatList) {
    if(urlList.length === 0) return;

    var addToMetaFileList = url => {
        if(repeatList.indexOf(url) >= 0) {
            return;
        }

        metaRecord = createdMetaFileRecords[url];
        if(metaRecord) {
            metaFileList.push(metaRecord);
            repeatList.push(url);
        }
    }

    urlList.forEach(addToMetaFileList);
}

