for(var key in comOverrideFiles) {
   var entry = comOverrideFiles[key];
   var names = [];
   var addToNames = url => {if(names.indexOf(url) < 0) names.push(url);}

   if(entry.data.themeOverrides) {
       for(var toName in entry.data.themeOverrides) {
           var urlList = entry.data.themeOverrides[toName];
           urlList.forEach(addToNames);
       }
   }

   if(names.length > 1) {
       output.push(key) 
   }
}

return output;
